import React from 'react';

const AboutUs = () => {
  return (
    <section className="min-h-screen p-10 bg-gray-100">
      <h1 className="text-4xl text-center font-bold mb-6">About Us</h1>
      <div className="max-w-4xl mx-auto">
        <p className="text-lg text-gray-700">
          We are a company dedicated to providing the best coffee tasting experience. Our story began with a passion for coffee and a dream to share that passion with the world.
        </p>
        <p className="text-lg text-gray-700 mt-4">
          At our coffee shop, each sip is crafted with care, and every customer is treated like family. We believe in the magic of coffee to bring people together and create lasting memories.
        </p>
      </div>
    </section>
  );
};

export default AboutUs;
